import axios from 'axios';
import React from 'react';
import { Button, Container, Row, Col, Alert, Table, Navbar, Nav, NavDropdown, Carousel, Card } from 'react-bootstrap';
import { withRouter } from 'react-router-dom';


class First extends React.Component{

    constuctor() {
        this.routeChange = this.routeChange.bind(this);
      }
    
    routeChange() {
        let path = `/register`;
        this.props.history.push(path);
    }

    render(){
        return(
            <div>
                <Card className="text-center bg-transparent">
                <h3><Card.Header>Upcoming Events</Card.Header></h3>
                <Card.Body>
                    <Card.Title>FEBRUARY 19TH - MARCH 5TH (VARIOUS TIMES) SMALL GROUP INFORMATION SESSIONS</Card.Title>
                    <Card.Text>
                    Meet with faculty from specific clinics to ask questions and learn more about the work they do before applications are due. <br/>
                    Registration links will be posted on this site by February 18th.
                    </Card.Text>
                    <Button variant="primary"  onClick={this.routeChange} >Register</Button>
                   
                </Card.Body>
                
                </Card>
                
            </div>
        )
        
    }
}

export default First;
